class Message:
    def __init__(self, func=''):
        self.msg = "what is the best name of the following asm function:\n" + func + '\n The answer should be 1-7 words'

    def send_msg(self):
        response = openai.ChatCompletion.create(
            model="gpt-3.5-turbo",
            messages=[
                {"role": "user", "content": self.msg},
            ]
        )

        result = ''
        for choice in response.choices:
            result += choice.message.content
        return result


def get_all_funcs(funcs_dir):
    for root, dirs, files in os.walk(funcs_dir):
        for filename in files:
            if 'sub_' not in filename:
                continue
            addr = filename.split("sub_")[1].split(".txt")[0].upper()
            dic_key = "sub_" + addr
            if dic_key in map.keys():
                func_name = map[dic_key]
            else:
                func_name = "not found in dict"
            with open(os.path.join(root, filename), 'r') as f:
                yield addr, func_name, '\n'.join(f.readlines())
                f.close()

def save_result(chatGPT_result, orig_func_name='BinarySearch', model_func_name='BinarySearch', addr="no_addr"):
    with open(RESULTS_FILE, 'a') as csv_file:
        csv_writer = writer(csv_file)
        csv_writer.writerow([addr, orig_func_name, model_func_name, chatGPT_result])
        csv_file.close()

def main():
    hist = []
    with open(RESULTS_FILE, 'r') as csv_file:
        csv_reader = reader(csv_file)
        for row in csv_reader:
            if len(row) >= 4:
                hist.append((row[0], row[1]))

    for addr, func_name, func in get_all_funcs(FUNC_DIR):
        if (addr, func_name) in hist:
            continue
        try:
            msg = Message(func)
            result = msg.send_msg()
            print(result)
            save_result(result, func_name, 'Todo', addr)
            sleep(20)
        except Exception as e:
            continue


if __name__ == '__main__':
    main()